String.prototype.toRovarspraket=function(){return this.toString().replace(/(b|c|d|f|g|h|j|k|l|m|n|p|q|r|s|t|v|w|x|z)/gi,function(a){return a+"o"+a.toLowerCase()})};String.prototype.fromRovarspraket=function(){return this.toString().replace(/(b|c|d|f|g|h|j|k|l|m|n|p|q|r|s|t|v|w|x|z)+o+(b|c|d|f|g|h|j|k|l|m|n|p|q|r|s|t|v|w|x|z)/gi,function(a){return a.substr(0,1)})};